let buyPrices = []; // hold all buy price here
let sellPrices = []; // hold all buy price here
for (let i = 0; i < trades.length; i++) {
    let item = trades[i];
    if (item.type === "buy") {
        buyPrices.push(item);
        sellPrices = [];
    } else if (item.type === "sell") {
        let sellPrice = item.price;

        for (let j = 0; j < buyPrices.length; j++) {
            if (buyPrices[j].price > sellPrice) {
                sellPrices.push(item);
                for(let k = i + 1; k < trades.length; k++) {
                    if(trades[k].type === "sell") {
                        sellPrices.push(trades[k]);
                    } else {
                        break;
                    }
                }
                printCase(item)            ;
                // console.log("loss at %j", {
                //     buy: buyPrices,
                //     sell: item
                // });
                break;
            }
        }

        buyPrices = [];
    }
}

function printCase() {
    for (let i = 0; i < buyPrices.length; i++) {
        let item = buyPrices[i];
        let data = findTimeData(item.time);
        let p1 = 100*(data.trend_ema - data.trend_ema_fast)/data.trend_ema_fast;
        let p2 = 100*(data.trend_ema - data.trend_ema_slow)/data.trend_ema_slow;
        let p = Math.sqrt(p1*p1 + p2*p2);
        console.log("buy: %s %s %s %s %s %s %s %s", item.time, item.price, data.trend_ema, data.trend_ema_fast, data.trend_ema_slow, p1, p2, p);
    }

    for (let i = 0; i < sellPrices.length; i++) {
        let item = sellPrices[i];
        let data = findTimeData(item.time);
        let p1 = 100*(data.trend_ema - data.trend_ema_fast)/data.trend_ema_fast;
        let p2 = 100*(data.trend_ema - data.trend_ema_slow)/data.trend_ema_slow;
        let p = Math.sqrt(p1*p1 + p2*p2);
        console.log("sell: %s %s %s %s %s %s %s %s", item.time, item.price, data.trend_ema, data.trend_ema_fast, data.trend_ema_slow, p1, p2, p);
    }
}

function findTimeData(time) {
    for (let i = 0; i < data.length; i++) {
        let item = data[i];
        if (item.time < time) {
            if (i < data.length) {
                return data[i + 1];
            } else {
                return data[data.length - 1];
            }
        }
    }
}